VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 0, 'August 10, 2024 Español Vaccine Basics What to know Modern vaccines contain only the ingredients that are needed for the vaccines to be as safe and effective as possible. Every vaccine ingredient serves a purpose To provide immunity We become immune to (or protected from) a disease when our bodies create specific antibodies to fight that disease. Vaccines contain ingredients that help your body build this immunity. To keep the vaccine safe and long-lasting Vaccines need to be safe and effective. Certain ingredients help keep vaccines safe from contamination and toxins. Others, like stabilizers, help vaccines stay effective for a long time. To make the vaccine more effective All vaccine ingredients help to make a vaccine as effective as possible, while being safe. Ingredients like aluminum salt help boost the body''s response to the vaccine.', '{0.030185498297214508,0.4620119631290436,0.42607778310775757,-0.7135094404220581,-0.1259227693080902,0.5818073749542236,-0.14398811757564545,0.32762643694877625,0.24490927159786224,-0.34349218010902405,-0.23027226328849792,0.27139177918434143,0.0871615782380104,-1.476738691329956,-1.0797916650772095,0.36687931418418884,0.018989020958542824,0.4391700327396393,0.23504450917243958,0.11410824954509735,-0.15094108879566193,-0.46094805002212524,-0.982900857925415,-0.26810094714164734,-0.3116700053215027,0.37782445549964905,-0.3936169743537903,-0.7970956563949585,0.617207944393158,0.8828969597816467,-0.6820171475410461,0.1683616191148758,0.3046100437641144,0.8079631328582764,-0.5828487277030945,0.12196837365627289,0.4381001889705658,0.9471228122711182,-0.21557065844535828,-0.08926547318696976,0.17909295856952667,0.7798102498054504,0.3964695334434509,-0.42975914478302,-0.8412728905677795,-0.1371152549982071,0.12243911623954773,-0.38339436054229736,0.9320361018180847,-0.09479240328073502,0.1659192442893982,0.11690173298120499,-0.3464299738407135,-0.6768761873245239