VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 2, 'that contain eggs Examples: Egg proteinB Residual antibiotics Purpose: To prevent contamination by bacteria during the vaccine manufacturing process Most commonly found in: Common antibiotics. Antibiotics that people are most likely to be allergic to—like penicillin—aren''t used in vaccines. Examples: Neomycin, Kanamycin, Streptomycin Preservatives Purpose: To prevent contamination Most commonly found in: Some kinds of fish Example: ThimerosalC (only in multi-dose vials of flu vaccine) Most vaccines don''t contain any mercury Most vaccines do not have any mercury in them. However, multi-dose flu vaccines and one type of tetanus-diphtheria (Td) vaccine contain a small amount of thimerosal. Thimerosal contains a form of mercury (ethylmercury) that does not cause mercury poisoning and is safe for use in vaccines. Flu and Td vaccines are also available in thimerosal-free versions.', '{-0.6865478157997131,0.14305326342582703,0.3042609691619873,-0.3781526982784271,-0.15012997388839722,0.052231188863515854,-0.13897965848445892,0.5332267880439758,0.16264259815216064,-0.3791622221469879,0.005505520850419998,0.7651370763778687,0.04038848727941513,-0.5893468260765076,0.4419722557067871,-0.2595566213130951,0.48011529445648193,0.4277080297470093,-0.3189575970172882,-0.20222967863082886,-0.15239651501178741,-0.4276784658432007,-0.33446118235588074,-0.47390294075012207,0.4734356999397278,0.13226065039634705,0.0299434382468462,-0.8751567006111145,-0.12211551517248154,0.3193422853946686,-0.2471178025007248,0.09251565486192703,0.6956568360328674,0.5193445682525635,-0.06680834293365479,0.4324648380279541,0.22241196036338806,0.9940364956855774,0.3186362087726593,-0.2285233736038208,-0.5574746131896973,0.2321554273366928,-0.17555128037929535,-0.16167670488357544,-1.4392446279525757,-0.024342084303498268,0.912545382976532,-0.38176578283309937,0.6647518277168274,-0.434872031211853,-0.3178175687789917,-0.00283921021036