VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 5, 'nfluenza and yellow fever vaccines are made in eggs, egg proteins are present in the final products. People with severe egg allergies should be vaccinated in a medical setting and be supervised by a health care professional who can recognize and manage severe allergic conditions. For people with egg allergies, there are also flu vaccines that have been made without using eggs in the manufacturing process. Thimerosal contains a different form of mercury (ethylmercury) than the kind that causes mercury poisoning (methylmercury). Ethylmercury is safe to use in vaccines because it''s processed differently in the body and is less likely to build up in the body—and because it''s used in tiny amounts. Even so, most vaccines do not have any thimerosal in them. Learn more about thimerosal, mercury, and vaccine safety.', '{-0.3532889187335968,0.08191224187612534,0.20093779265880585,-0.522608757019043,-0.25780779123306274,0.2576811909675598,0.17965541779994965,0.338285893201828,-0.18472376465797424,-0.31619590520858765,0.40419042110443115,0.6389296650886536,0.17905880510807037,-0.8503760099411011,-0.25757113099098206,0.09233155101537704,0.6346275210380554,0.5511882305145264,-0.4116511642932892,-0.23893438279628754,-0.48956775665283203,-0.38169243931770325,-0.45498159527778625,-0.23997749388217926,0.3196454644203186,0.04862231761217117,-0.040621090680360794,-0.7322878241539001,-0.29922401905059814,0.21335026621818542,-0.3592994511127472,0.08109968900680542,0.32709696888923645,0.686957061290741,-0.3197668492794037,0.4423595368862152,-0.021691052243113518,0.9714949727058411,-0.0116987694054842,-0.24242454767227173,-0.5796669125556946,0.23769687116146088,0.27153366804122925,-0.24103496968746185,-1.342206358909607,0.2073034793138504,0.8443505764007568,-0.4066077768802643,0.6153419613838196,-0.03308907896280289,-0.19687004387378693,0.049389492720365524,-0.34284552931785583,-0.544084906578064,-1.6369006633758545,