VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 0, 'March 22, 2024 Arthritis Basics Key points Arthritis affects about 1 in 5 U.S. adults. It affects the joints, tissues around the joint, and other connective tissues. Arthritis is a leading cause of work disability among adults. People with other chronic conditions—such as obesity, diabetes, and heart disease—often have arthritis. Overview Arthritis is a general term for conditions that affect the joints, tissues around joints, and other connective tissues. There are more than 100 types of arthritis. The causes of some forms of arthritis are unknown. Did you know? About 54 million U.S. adults have arthritis.1 The number of people with arthritis is expected to increase as the population grows and ages.2 Risk factors Some behaviors and characteristics can increase your chances of developing arthritis. Several of these risk factors are within your control, including: Smoking. Having overweight or obesity. Joint injuries—like from sports, falls, and accidents.', '{0.09989897161722183,0.04115854948759079,0.32161420583724976,-0.17680741846561432,-0.1998254507780075,0.5709870457649231,-0.4524422883987427,1.5984737873077393,-0.2607457935810089,-0.7434976696968079,0.0971834659576416,0.1658710241317749,0.6382120847702026,-0.49295276403427124,-0.39162400364875793,0.2977864742279053,0.6487211585044861,-0.19174934923648834,0.2912120521068573,0.18952463567256927,-0.6907440423965454,-0.6523277759552002,-0.2829265296459198,0.3640380799770355,0.41666218638420105,0.22644327580928802,-0.8333789110183716,-0.32746317982673645,0.5782923698425293,0.329323947429657,-0.14230330288410187,0.47422999143600464,-0.036417149007320404,-0.08911054581403732,0.17307397723197937,-0.055430974811315536,-0.27870801091194153,0.3232559263706207,-0.5432983636856079,-0.19522468745708466,-0.13331547379493713,0.40144702792167664,-0.11906901001930237,-0.8036482930183411,0.11823674291372299,0.9609060287475586,1.1269807815551758,-0.20928095281