VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 1, 'uding: Smoking. Having overweight or obesity. Joint injuries—like from sports, falls, and accidents. Work-related activities that lead to joint injury—like bending, squatting, and other repetitive motions. Learn more about risk factors and what you can do lower your risk of developing arthritis. Symptoms and diagnosis Symptoms vary by arthritis type but usually include joint pain and stiffness. Health care providers can diagnose arthritis by: Reviewing your health and family history. Doing a physical exam. Taking X-rays. Doing lab tests (as needed). Once you know the type of arthritis you have, you can work with your provider to decide on the best ways to manage and treat it. Managing your arthritis It is important to manage symptoms Managing arthritis symptoms helps you: Prevent or delay it from getting worse or causing disability. Reduce pain. Improve your overall health and well-being.', '{0.30084142088890076,0.13423840701580048,0.1860666573047638,-0.47073039412498474,-0.3992583155632019,0.6667587757110596,-0.6754935383796692,1.1271271705627441,-0.4020823836326599,-0.6566042900085449,0.35327884554862976,0.3223673701286316,0.5512093305587769,-0.5165402889251709,-0.6440724730491638,0.2956292927265167,0.2400183081626892,-0.02886706031858921,0.06481009721755981,-0.05468849837779999,-0.4582374691963196,-0.7380907535552979,-0.16702716052532196,0.26195988059043884,0.5126849412918091,-0.01583881676197052,-0.7593353986740112,-0.36284324526786804,0.855679452419281,0.18857228755950928,0.0042209564708173275,0.7008205652236938,0.06411855667829514,0.16403397917747498,-0.18424898386001587,-0.26962530612945557,-0.29969727993011475,0.18340040743350983,-0.7465104460716248,-0.06570189446210861,-0.15503676235675812,0.5032832026481628,-0.27969470620155334,-0.925780713558197,-0.42681172490119934,0.8568573594093323,0.940995454788208,-0.04068344458937645,0.0012250870931893587,0.03399962931871414,-0.27806606888771057