VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 2, 't from getting worse or causing disability. Reduce pain. Improve your overall health and well-being. Ways to manage arthritis Five ways to manage arthritis and its symptoms: Learn self-management skills. Be physically active. Manage your weight. Protect your joints. Talk to your health care provider if you have symptoms. The earlier you receive an arthritis diagnosis, the sooner you can begin treatment to lessen its effects and prevent or delay it from getting worse. Joint-friendly physical activity—like walking—can help arthritis pain. Treatment Treatment options There is no cure for arthritis, but it can be treated and managed. Treatments vary depending on arthritis type. They may include: Over-the-counter medicines. Physical therapy. Prescription medicines. Surgery, if needed. Your provider will talk to you about these and other treatment options that are right for your arthritis type and personal needs.', '{0.10817237943410873,0.19163332879543304,0.255296915769577,-0.5013035535812378,-0.07939323037862778,0.9416911005973816,-0.3662460148334503,1.126384973526001,-0.5120708346366882,-1.1680375337600708,0.2842184007167816,0.4595339596271515,0.3060350716114044,-0.5643951892852783,-0.2578459680080414,0.2025134563446045,0.1705150157213211,-0.16256287693977356,0.1711990237236023,0.03848782554268837,-0.6414583921432495,-0.3807549476623535,-0.11804860830307007,0.047163814306259155,0.569743275642395,0.2042410671710968,-0.9113406538963318,-0.31099626421928406,0.9168863892555237,0.11992234736680984,-0.12067335844039917,0.8432182669639587,0.10320902615785599,0.12058021873235703,-0.26167383790016174,-0.39195260405540466,-0.5534796714782715,-0.065379299223423,-0.6536880731582642,-0.2759321928024292,0.09737782925367355,0.8570203185081482,-0.6242610216140747,-0.6343675851821899,-0.19973483681678772,0.5141255855560303,0.952680766582489,-0.08550271391868591,-0.13933147490024567,-0.1665143519639969,0.05478445068