VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 0, 'Mental Health On this page Basics Summary Start Here Diagnosis and Tests Learn More Related Issues Specifics See, Play and Learn No links available Research Clinical Trials Journal Articles Resources Find an Expert For You Children Teenagers Men Women Older Adults Patient Handouts Summary What is mental health? Mental health includes our emotional, psychological, and social well-being. It affects how we think, feel, and act as we cope with life. It also helps determine how we handle stress, relate to others, and make choices. Mental health is important at every stage of life, from childhood and adolescence through adulthood and aging. What are mental disorders? Mental disorders are serious conditions that can affect your thinking, mood, and behavior. They may be occasional or long-lasting. They can affect your ability to relate to others and function each day. Mental disorders are common; many Americans will be diagnosed with one at some time in their life. But there are treatments.', '{-0.6841033697128296,-0.11742523312568665,0.7727168202400208,-0.6116376519203186,0.28409188985824585,0.9229191541671753,-0.3913785517215729,0.1513446867465973,-0.8159309029579163,-0.45223942399024963,0.50396329164505,0.38715827465057373,-0.12098762392997742,0.18589448928833008,-0.6863262057304382,0.27273720502853394,0.28930094838142395,0.45646876096725464,-0.11562823504209518,0.20866407454013824,0.02120654471218586,-0.5333558320999146,-1.1018242835998535,-0.5818489193916321,-0.024901730939745903,-0.19579188525676727,-0.3896685242652893,-0.5807899236679077,-0.12783227860927582,0.7721828818321228,-0.9955220222473145,0.37660545110702515,-0.39076048135757446,0.48154595494270325,-0.06623296439647675,-0.4148798882961273,-0.1518128514289856,0.45028936862945557,0.5681493282318115,0.010146533139050007,-0.5089439153671265,-0.8333345651626587,-0.6439059376716614,0.6478763222694397,-0.7272910475730896,0.2148880958557129,0.402