VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 1, 'mon; many Americans will be diagnosed with one at some time in their life. But there are treatments. People with mental disorders can get better, and many of them recover completely. Why is mental health important? Mental health is important because it can help you to: Cope with the stresses of life Be physically healthy Have good relationships Make meaningful contributions to your community Work productively Realize your full potential Your mental health is also important because it can affect your physical health. For example, mental disorders can raise your risk for physical health problems such as stroke, type 2 diabetes, and heart disease. What can affect my mental health?', '{-0.28499284386634827,-0.3138372004032135,0.7164240479469299,-0.21550540626049042,0.1780218631029129,0.9050811529159546,-0.4244380295276642,0.5090600848197937,-0.8248482346534729,-0.42013925313949585,0.36030566692352295,0.368761271238327,-0.16803711652755737,-0.042308248579502106,-0.614208459854126,0.20243756473064423,0.3118286430835724,0.31801339983940125,-0.10249096155166626,-0.0640535056591034,-0.2539224326610565,-0.6051921248435974,-0.8118544816970825,-0.39693331718444824,-0.01761852763593197,-0.03980312496423721,-0.2622081935405731,-0.9016961455345154,0.09089686721563339,1.2502413988113403,-0.8953611850738525,0.4895752966403961,-0.44129034876823425,0.3321153521537781,-0.06806113570928574,-0.47077882289886475,0.006767053157091141,0.4125785827636719,0.6177421808242798,-0.46714547276496887,-0.4057648777961731,-0.815061628818512,-0.2807910144329071,0.29109659790992737,-0.5328882336616516,-0.05794200673699379,0.46561160683631897,-0.2559936046600342,0.6212961077690125,0.28736230731010437,-0.23257127404212952,0.01121549867093563,-0.1803032010793686,0.656305193901062,1.038327693939209,0.4444660544395447,-0.8235339522361755,0.17099322378635406,-0.4208584129810333,0.18839043378829956,-0.2267601042985916,-0.13681216537952423