VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 2, 'ealth problems such as stroke, type 2 diabetes, and heart disease. What can affect my mental health? There are many different factors that can affect your mental health, including: Biological factors, such as genes or brain chemistry Life experiences, such as trauma or abuse Family history of mental health problems Your lifestyle, such as diet, physical activity, and substance use You can also affect your mental health by taking steps to improve it, such as doing meditation, using relaxation techniques, and practicing gratitude. Can my mental health change over time? Over time, your mental health can change. For example, you may be dealing with a difficult situation, such as trying to manage a chronic illness, taking care of an ill relative, or facing money problems. The situation may wear you out and overwhelm your ability to cope with it. This can worsen your mental health. On the other hand, getting therapy may improve your mental health.', '{-0.19249507784843445,-0.19902579486370087,0.8490285873413086,-0.20851978659629822,0.5210486650466919,0.5088427662849426,-0.15375970304012299,0.3177257776260376,-0.6672671437263489,-0.11028085649013519,0.633677065372467,0.5484104752540588,-0.4409782886505127,-0.0349435918033123,-0.6000165343284607,0.12815195322036743,0.12345010042190552,0.1448066532611847,0.24242161214351654,0.20580412447452545,-0.11327262967824936,-0.4196041524410248,-0.757534384727478,-0.3112099766731262,-0.24050186574459076,0.04204971715807915,-0.12324564158916473,-0.6943525671958923,-0.06398800760507584,0.801213264465332,-0.9138540625572205,0.7606939077377319,-0.26456019282341003,0.7046447396278381,0.1871623694896698,-0.6576961278915405,-0.2985196113586426,0.2658798396587372,0.5050264596939087,-0.252566933631897,-0.607733964920044,-1.215977430343628,-0.09767933934926987,0.672938883304596,-0.465309739112854,-0.24713730812072754,0.528721272945404,-0.19218765199184418,0.7765930891036987,