VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 1, 'mors aren''t cancer, while malignant ones are. Cells from malignant tumors can invade nearby tissues. They can also break away and spread to other parts of your body. The spread of cancer from one part of the body to another is called metastasis. Symptoms and treatment depend on the type of cancer and how advanced it is. What are the types of cancer? There are more than 100 different types of cancer. Cancer can start almost anywhere in your body. Most cancers are named for where they start. For example, lung cancer starts in the lung, and breast cancer starts in the breast. Cancer may also be described by the type of cell that formed it, such as sarcoma if cancer begins in your bone and soft tissue. Carcinoma is the most common type of cancer. It is formed by epithelial cells, the cells that cover the inside and outside surfaces of your body. How does cancer develop? Cancer is a genetic disease. That means changes in your genes cause it.', '{-0.26674389839172363,-0.19729956984519958,0.19654352962970734,-0.073551245033741,0.6163919568061829,-0.13108067214488983,-0.1501714289188385,0.3469516336917877,-0.6049493551254272,0.3458693027496338,-0.08303400129079819,0.1143098995089531,-0.12062836438417435,-0.5422366261482239,-1.0066232681274414,-0.6698446273803711,0.17127269506454468,0.48070254921913147,0.6063509583473206,-0.4653262495994568,0.030369428917765617,0.10799826681613922,-0.7875699400901794,0.04631836339831352,-0.4950082302093506,0.3644084632396698,-0.8103213906288147,-0.015080451965332031,-0.4927729666233063,0.4062897264957428,-1.3326178789138794,-0.18734660744667053,0.7975288033485413,0.25555771589279175,0.09478902071714401,0.036692064255476,0.06859908252954483,0.3772118389606476,-0.6939008235931396,-0.6553734540939331,0.6187880635261536,-0.46136176586151123,-0.7266225218772888,0.07895670086145401,-0.12265291810035706,-0.35142281651496887,0.5099624395370483,-0.6690672039985657,0.401218771934