VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 2, 'dy. How does cancer develop? Cancer is a genetic disease. That means changes in your genes cause it. Changes in your genes are also called gene variants or mutations. Genes are parts of DNA in your cells that you inherit from your parents. However, only some cancers are caused by genes passed down from your parents. Genetic changes can occur to your genes over your lifetime that affect how your cells function. Usually, your body gets rid of damaged cells before they turn cancerous, but this ability goes down as you age. Other factors that may affect your risk of developing cancer can include: Exposure to ultraviolet (UV) rays from the sun Smoking Your diet Physical inactivity What are the symptoms of cancer? Cancer symptoms depend on the type of cancer.', '{-0.1294865906238556,-0.5507863759994507,0.39323335886001587,-0.1534353345632553,0.719883918762207,-0.132751002907753,0.11985379457473755,0.4201827347278595,-0.22438286244869232,0.6792681217193604,-0.05620495229959488,0.6706258058547974,0.06567764282226562,-0.7669636011123657,-1.0469890832901,-0.23974882066249847,0.28185728192329407,-0.10533760488033295,0.09972653537988663,-0.20046482980251312,0.46459370851516724,0.24022623896598816,-0.8476383090019226,-0.018686775118112564,-0.14444230496883392,-0.04898097366094589,-0.4987298250198364,0.29749795794487,-0.053336236625909805,0.0607031024992466,-0.7257741093635559,0.477425217628479,0.7642930746078491,0.33073869347572327,0.1703445315361023,0.4813188910484314,0.4413473904132843,1.1532775163650513,-0.2003667950630188,-0.775169312953949,0.29648780822753906,-0.6212071180343628,-0.08790626376867294,-0.4253024160861969,-0.13364490866661072,-0.12749148905277252,0.7284367084503174,-0.5670411586761475,-0.01608847640454769,-0.27926909923553467,-1.0158449411392212,-0.21729713678359985,-0.8003057241439819,0.5170757174491882,1.151733636856079,-0.12095142155885696,-0.79080730676651,-0.4346717596054077,-0.050752