VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 3, 't Physical inactivity What are the symptoms of cancer? Cancer symptoms depend on the type of cancer. For example, some of the symptoms that cancer may cause can include: A lump in your breast Blood in your urine (pee) or stool (poop) Bleeding or bruising for no known reason A sore that doesn''t heal Trouble swallowing A new mole or a change to a mole you already have Cancer may cause various symptoms but often doesn''t cause pain. Don''t wait until you''re having pain before seeing your health care provider. See your provider if you have symptoms that don''t get better in a few weeks. How is cancer diagnosed? There is no single test that can diagnose cancer. The tests ordered are usually based on your symptoms.', '{0.2638624310493469,-0.3993464410305023,0.5340732336044312,-0.6209718585014343,0.038432661443948746,0.5124929547309875,-0.7548753023147583,0.5990252494812012,-0.46922656893730164,-0.20401576161384583,-0.28833141922950745,0.7480147480964661,0.3518581688404083,-0.47405368089675903,-0.1926971971988678,-0.2320965975522995,-0.3658812940120697,-0.4908207952976227,0.40097421407699585,-0.6058306694030762,-0.7266326546669006,0.06152310222387314,-0.6291567087173462,-0.17032042145729065,-0.46037447452545166,-0.09370207786560059,-0.41438212990760803,-0.41853803396224976,0.11591450870037079,-0.0038387610111385584,-0.7246658205986023,0.16803088784217834,0.5457041263580322,0.3513388931751251,-0.03478918597102165,0.12574796378612518,0.3252999186515808,0.5903415083885193,-0.5523896813392639,-0.45218589901924133,0.47734305262565613,0.030089227482676506,-0.7346342206001282,-0.7525838017463684,-0.2909208834171295,0.5448639988899231,0.6522155404090881,-0.25631535053253174,0.733064591884613,0.047799136489629745,-0.4398089647293091,-0.12616175413131714,-0.2733610272407532,0.5110369920730591,0.8652898669242859,0.19962351024150848,-0.027880962938070297,-0.4810192286968231,0.45639699697494507,0.2006655633449554