VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 4, 're is no single test that can diagnose cancer. The tests ordered are usually based on your symptoms. Your provider may: Ask about your medical history Ask about your family health history, including relatives who have had cancer Do a physical exam Do a screening test such as a mammogram, colonoscopy, or a Pap test Order blood tests or imaging tests To find out if you have cancer, your provider may order a biopsy. A biopsy is the procedure of removing and examining tissue, cells, or fluids from your body. What are the treatments for cancer? Treatment depends on the type of cancer and how advanced it is. Most treatment plans may include surgery, radiation, and/or chemotherapy. Some may involve hormone therapy, immunotherapy or other types of biological therapy, or stem cell transplantation. Can cancer be prevented? It''s usually not possible to know exactly why cancer develops in some people but not others.', '{-0.2073601931333542,-0.5391560196876526,0.7402899861335754,-0.5589911937713623,0.1114489808678627,0.10675867646932602,-0.2402791827917099,0.3294509947299957,-0.5341169834136963,0.3913184702396393,-0.2868597209453583,0.8933142423629761,0.2456822693347931,-0.06473702192306519,-0.16643492877483368,-0.31732434034347534,0.06002514064311981,0.014447574503719807,0.01179788913577795,-0.5530638098716736,-0.16346004605293274,0.1289706975221634,-0.7805436849594116,-0.1596013903617859,-0.2572036385536194,-0.1398726999759674,-0.36401721835136414,-0.05633600801229477,-0.3881532549858093,-0.49494680762290955,-1.1663638353347778,-0.05042566731572151,0.7400475740432739,0.1680443435907364,-0.2268175184726715,0.08852625638246536,0.015001636929810047,0.6330127716064453,-0.7320601940155029,-0.8934175968170166,0.009608231484889984,0.2307809591293335,-0.7519389390945435,-0.14928343892097473,-0.4431748390197754,0.3919658362865448,0.3235989212989807,-0.31524011492729187,0.893866777420044,0.0440916046500206,-0.71146