VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 1, 'up with air, like a small balloon. When you breathe out, the air sacs deflate, and the air goes out. If you have COPD, less air flows in and out of your airways because of one or more problems: The airways and air sacs in your lungs become less elastic The walls between many of the air sacs are destroyed The walls of the airways become thick and inflamed The airways make more mucus than usual and can become clogged What are the types of COPD (chronic obstructive pulmonary disease)? COPD includes two main types: Emphysema affects the air sacs in your lungs, as well as the walls between them. They become damaged and are less elastic. Chronic bronchitis, in which the lining of your airways is constantly irritated and inflamed. This causes the lining to swell and make mucus. Most people with COPD have both emphysema and chronic bronchitis, but how severe each type is can be different from person to person. What causes COPD (chronic obstructive pulmonary disease)?', '{0.8756710290908813,-0.7144004702568054,0.7248170971870422,0.0029811777640134096,0.48584336042404175,1.0312294960021973,0.2937130630016327,-0.014721577987074852,-0.016009902581572533,-0.37468838691711426,0.16935871541500092,-0.20265698432922363,-0.18060149252414703,-0.20990312099456787,-0.6685415506362915,-0.17729856073856354,0.23496486246585846,0.08782920986413956,0.8845922350883484,-0.3689759075641632,-1.0463807582855225,-0.4513635039329529,-0.12313631176948547,-0.431665301322937,-0.6990115642547607,1.0725115537643433,-0.7690722346305847,0.06403940916061401,-0.18287481367588043,0.21760572493076324,-0.48423653841018677,0.24778123199939728,-0.6692371964454651,0.21778708696365356,-0.24234671890735626,0.17775453627109528,-0.2067939192056656,0.6901552677154541,-1.0422550439834595,-0.023274904116988182,-0.13771362602710724,0.8252946734428406,0.07330342382192612,-0.27940359711647034,0.1788889616727829,0.08071419596672058,0.5484879612922668,-0