VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 2, 'is can be different from person to person. What causes COPD (chronic obstructive pulmonary disease)? The cause of COPD is usually long-term exposure to irritants that damage your lungs and airways. In the United States, cigarette smoke is the main cause. Pipe, cigar, and other types of tobacco smoke can also cause COPD, especially if you inhale them. Exposure to other inhaled irritants can contribute to COPD. These include secondhand smoke, air pollution, and chemical fumes or dusts from the environment or workplace. Rarely, a genetic condition called alpha-1 antitrypsin deficiency can play a role in causing COPD. Who is at risk for COPD (chronic obstructive pulmonary disease)? The risk factors for COPD include: Smoking. This is the main risk factor. Up to 75% of people who have COPD smoke or used to smoke. Long-term exposure to other lung irritants, such as secondhand smoke, air pollution, and chemical fumes and dusts from the environment or workplace Age.', '{1.021193027496338,-0.8418412804603577,0.6194393038749695,0.24271686375141144,0.6313367486000061,0.8127903938293457,0.6289334297180176,0.1109158918261528,0.22399979829788208,-0.07397828251123428,0.2200557142496109,0.012150897644460201,-0.06000741943717003,-0.4586302638053894,-0.10629742592573166,-0.17525739967823029,0.4365319013595581,0.16708023846149445,0.828652024269104,-0.623674750328064,-0.7155642509460449,-0.13527877628803253,-0.49437645077705383,-0.408765971660614,-1.000093698501587,1.1379836797714233,-0.5451722741127014,0.10847782343626022,-0.1484406441450119,0.6090661883354187,-0.4176129400730133,0.4638162851333618,-0.3208716809749603,0.21398180723190308,-0.5306248068809509,0.33337655663490295,0.049048274755477905,1.0913935899734497,-0.9473826289176941,-0.04566958174109459,-0.19216273725032806,0.40503183007240295,0.2556794285774231,-0.0394161157310009,0.06739191710948944,0.3121962249279022,0.8239332437515259,-0.5430465936660767,-0.