VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 3, 'secondhand smoke, air pollution, and chemical fumes and dusts from the environment or workplace Age. Most people who have COPD are at least 40 years old when their symptoms begin. Genetics. This includes alpha-1 antitrypsin deficiency, which is a genetic condition. Also, smokers who get COPD are more likely to get it if they have a family history of COPD. Asthma. People who have asthma have more risk of developing COPD than people who don''t have asthma. But most people with asthma will not get COPD. What are the symptoms of COPD (chronic obstructive pulmonary disease)? At first, you may have no symptoms or only mild symptoms. As the disease gets worse, your symptoms usually become more severe. They can include: Frequent coughing or a cough that produces a lot of mucus Wheezing A whistling or squeaky sound when you breathe Shortness of breath, especially with physical activity Tightness in your chest Some people with COPD get frequent respiratory infections such as colds and the flu.', '{0.9230546951293945,-0.9256689548492432,0.6799591779708862,-0.1323619931936264,0.339191734790802,1.1655818223953247,0.48131754994392395,0.040551699697971344,0.036971624940633774,-0.45392802357673645,0.3514920175075531,0.28420063853263855,0.06693350523710251,-0.5681366920471191,-0.5233062505722046,0.020825572311878204,0.6761637330055237,0.05199221521615982,0.8235681653022766,-0.2727757394313812,-0.8313956260681152,-0.42437809705734253,-0.300380140542984,-0.43431076407432556,-0.7052663564682007,0.9441654086112976,-0.6731275916099548,-0.08169731497764587,0.15502439439296722,0.510837733745575,-0.5366079211235046,0.29075974225997925,-0.7440035939216614,0.2706770598888397,-0.21259914338588715,0.3760651648044586,-0.05802958458662033,0.8439013361930847,-0.9272414445877075,-0.08714594691991806,0.09482743591070175,0.6403535604476929,-0.06897398829460144,-0.4326525330543518,-0.0953197181224823,0.2844839096069336,0.810165464