VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 4, 's in your chest Some people with COPD get frequent respiratory infections such as colds and the flu. In severe cases, COPD can cause weight loss, weakness in your lower muscles, and swelling in your ankles, feet, or legs. How is COPD (chronic obstructive pulmonary disease) diagnosed? Your health care provider may use many tools to make a diagnosis: A medical history, which includes asking about your symptoms A family history Various tests, such as lung function tests, a chest x-ray or CT scan, and blood tests Your doctor will diagnose COPD based on your signs and symptoms, your medical and family histories, and test results. What are the treatments for COPD (chronic obstructive pulmonary disease)? There is no cure for COPD. However, treatments can help with symptoms, slow the progress of the disease, and improve your ability to stay active. There are also treatments to prevent or treat complications of the disease.', '{1.0014128684997559,-0.8699641227722168,0.7914817333221436,-0.10339120775461197,0.4293042719364166,1.1263506412506104,0.2793941795825958,0.06366658955812454,-0.1486361175775528,-0.5827009677886963,-0.021938564255833626,0.2722432613372803,0.19613918662071228,-0.14831499755382538,-0.21677714586257935,-0.14670833945274353,0.3699021339416504,-0.058026500046253204,0.9143924713134766,-0.1767427772283554,-0.9686115384101868,-0.321355402469635,-0.4015917479991913,-0.5077819228172302,-0.675586462020874,0.9584535956382751,-0.6497969031333923,-0.18540985882282257,0.006504569202661514,-0.08068511635065079,-0.6144391298294067,0.29699793457984924,-0.5428243279457092,0.21158850193023682,-0.34590575098991394,-0.015129681676626205,-0.10562486201524734,0.8828294277191162,-1.1928976774215698,-0.12844577431678772,-0.24395833909511566,1.0709137916564941,-0.33397620916366577,-0.08510041236877441,-0.24909938871860504,0.4906589984893799,0.752037763595581,-0.10878484696149826,0.11804278194904327,0.06990907