VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 5, 'ability to stay active. There are also treatments to prevent or treat complications of the disease. Treatments include: Lifestyle changes, such as Quitting smoking if you are a smoker. This is the most important step you can take to treat COPD. Avoiding secondhand smoke and places where you might breathe in other lung irritants Ask your health care provider for an eating plan that will meet your nutritional needs. Also ask about how much physical activity you can do. Physical activity can strengthen the muscles that help you breathe and improve your overall wellness. Medicines, such as Bronchodilators, which relax the muscles around your airways. This helps open your airways and makes breathing easier. Most bronchodilators are taken through an inhaler. In more severe cases, the inhaler may also contain steroids to reduce inflammation.', '{0.9774662852287292,-0.4746444523334503,0.4546090364456177,-0.2839328944683075,0.3711329698562622,1.0625057220458984,-0.10588469356298447,-0.22126883268356323,-0.0006880804430693388,-0.5066336989402771,0.21459046006202698,-0.2074509859085083,0.05431647226214409,-0.9181668162345886,-0.7272353768348694,0.15291164815425873,0.23325622081756592,-0.5319684147834778,0.5156660079956055,-0.13374295830726624,-0.9970378875732422,-0.43880391120910645,-0.20016199350357056,-0.8293673396110535,-0.3960455358028412,0.7400655150413513,-0.7879407405853271,-0.18503324687480927,0.8645891547203064,0.07089141756296158,-0.6207304000854492,0.6027277708053589,-0.41097766160964966,0.27418673038482666,-0.2816852629184723,-0.03497503697872162,-0.2398870289325714,0.26817142963409424,-0.6075900793075562,-0.1801966279745102,0.4006141126155853,0.7200522422790527,-0.7104742527008057,-0.3821317255496979,-0.7538345456123352,-0.08086854964494705,0.40572696924209595,-0.6767453551292419,0.3687095046043396,0.4365111291408539,-0.4485999643802643,0.26595377922058105,-0.3217788636684418,0.716327428817749