VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 6, 'ough an inhaler. In more severe cases, the inhaler may also contain steroids to reduce inflammation. Vaccines for the flu and pneumococcal pneumonia, since people with COPD are at higher risk for serious problems from these diseases Antibiotics if you get a bacterial lung infection Oxygen therapy, if you have severe COPD and low levels of oxygen in your blood. Oxygen therapy can help you breathe better. You may need extra oxygen all the time or only at certain times. Pulmonary rehabilitation, which is a program that helps improve the well-being of people who have chronic breathing problems. It may include An exercise program Disease management training Nutritional counseling Psychological counseling Surgery, usually as a last resort for people who have severe symptoms that have not gotten better with medicines: For COPD that is mainly related to emphysema, there are surgeries that: Remove damaged lung tissue Remove large air spaces (bullae) that can form when air sacs are destroyed.', '{0.7509353160858154,-0.7406261563301086,0.6379783153533936,-0.25581109523773193,0.2733578383922577,0.9330819249153137,0.04761022329330444,-0.2587100565433502,-0.4366227388381958,-0.391379714012146,0.45212996006011963,-0.05376493185758591,-0.4251123070716858,-0.8290833830833435,-0.6010005474090576,-0.11974065005779266,0.4238188862800598,-0.3555758595466614,0.9257338643074036,-0.1960056573152542,-1.0077393054962158,-0.41993266344070435,-0.26712414622306824,-0.7042781710624695,-0.42912963032722473,0.8512672185897827,-0.7497683763504028,-0.11295842379331589,0.6363382339477539,0.2954699397087097,-0.8846734166145325,0.5257471799850464,-1.0307320356369019,0.5981929302215576,-0.4767662286758423,0.08459611237049103,-0.3962615430355072,0.2872801423072815,-0.8137335181236267,0.01687123067677021,0.4457346200942993,0.9913451671600342,-0.46084123849868774,-0.34140509366989136,-0.5545083284378052,-0.17502500116825104,0.122225232