VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 7, 'move damaged lung tissue Remove large air spaces (bullae) that can form when air sacs are destroyed. The bullae can interfere with breathing. For severe COPD, some people may need lung transplant If you have COPD, it''s important to know when and where to get help for your symptoms. You should get emergency care if you have severe symptoms, such as trouble catching your breath or talking. Call your health care provider if your symptoms are getting worse or if you have signs of an infection, such as a fever. Can COPD (chronic obstructive pulmonary disease) be prevented? Since smoking causes most cases of COPD, the best way to prevent it is to not smoke. It''s also important to try to avoid lung irritants such as secondhand smoke, air pollution, chemical fumes, and dusts.', '{0.8212077617645264,-0.7439670562744141,0.5233109593391418,-0.07215773314237595,0.39711183309555054,1.1429234743118286,0.09917252510786057,-0.11842630803585052,0.058079853653907776,-0.30117204785346985,0.18446296453475952,0.29652640223503113,-0.2937457859516144,-0.38877415657043457,-0.2974873185157776,-0.22944189608097076,0.15982720255851746,-0.17602954804897308,0.5990208983421326,-0.3177655339241028,-0.9967777132987976,-0.37274178862571716,-0.23644909262657166,-0.5038824677467346,-0.3548586070537567,0.8930647969245911,-0.6799048185348511,-0.14201079308986664,0.1282038539648056,0.23433756828308105,-0.8357036113739014,0.29181116819381714,-0.4594880938529968,0.41835927963256836,-0.45164966583251953,0.027947044000029564,-0.11785535514354706,0.3675585091114044,-0.7936319708824158,0.058654315769672394,0.17069776356220245,0.4482075273990631,-0.27080652117729187,0.0387728326022625,-0.36852937936782837,0.16626346111297607,0.3788742125034332,-0.31911322474479675,0.3098035454750061,0.5661314129829407,-0.46999722719192505,0.1259678602218628,-0.3387821912765503,0.7761772871017456,-0.6522733569145203,0.104636549949646,0.5247522592544556,-0